import { Link } from 'react-router-dom';
import { Icon } from 'semantic-ui-react'
import './styles.scss';

import { H4 } from '../../../components';

// image
import logoImage from '../../../assets/images/logo/logo.svg';

class Header extends Component {

  // state = {

  // };

  render() {
    // const {
    //   state: { }
    // } = this;

    return (
      <div className="ds-footer">
        <div className="footer-section">
          <div className="container">
            <div class="footer-logo mb-24">
              <img src={logoImage} alt="footer-logo" />
            </div>
            <div class="menu-section">
              <div class="menu-column">
                <H4 className="list-title mb-12">Navigate</H4>
                <ul class="menu-list">
                  <li class="menu-item">
                    <a href="#">Our Product</a>
                  </li>
                  <li class="menu-item">
                    <a href="#">About Us</a>
                  </li>
                  <li class="menu-item">
                    <a href="#">Contact Us</a>
                  </li>
                </ul>
              </div>
              <div class="menu-column">
                <H4 className="list-title mb-12">Contact Us</H4>
                <ul class="menu-list">
                  <li class="menu-item">
                    <a href="#"> 
                    <Icon fitted name='map marker alternate' />

                    </a>
                  </li>
                  <li class="menu-item">
                    <a href="#">About Us</a>
                  </li>
                  <li class="menu-item">
                    <a href="#">Contact Us</a>
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
        <div className="copyright-section">
          <div className="container">
            <p>Copyright Â© 2019 PT.Interindo Tooling | All rights reserved.</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
